import React from "react";
import Main from "./Main/Main";
import background from "./resources/background.jpg"

function App() {
  const appStyle= {
    height: "100%", 
    backgroundImage: `url(${background})`
  }

  return (
    <div style={appStyle}>
      <Main />
    </div>
  );
}

export default App;
